.currentSymbol {
  height: 112px;
  display: flex;
  background-color: #fff;
  border-radius: 12px;
  box-shadow: 0px 3px 6px 0px rgba(0, 0, 0, 0.04);
  margin-bottom: 30px;
  border-bottom: none;
  .operations-btn {
    width: 223px;
    padding-left: 24px;
    padding-right: 0;
    border-right: 0;
    height: 100%;
    display: flex;
    align-items: baseline;
    justify-content: center;
    flex-direction: column;
  }
  .symbol-info {
    width: calc(100% - 223px);
    display: flex;
    height: 100%;
    .info-item {
      width: 16.7%;
      height: 100%;
      display: flex;
      padding-left: 24px;
      padding-right: 0;
      border-left: 1px solid #EEEEEF;
      text-align: left;
      flex-direction: column;
      align-items: baseline;
      justify-content: center;
    }
    .tit {
      font-size: 14px;
      line-height: 22px;
      border-bottom: none;
    }
    .vla {
      font-size: 14px;
      line-height: 20px;
      font-weight: 600;
      color: #16161F;
    }
  }
  .activePrice i {
    background: none;
  }
}
